        setname(event.target.value)
    }
    const submitHandler=event=>{
        event.preventDefault()
        axios.get('https://api.unsplash.com/photos/?client_id=nOjAEY5Od5zh0fLWjNVtyWern1Sjj_lUpvb6Oi_F1cg').then((response)=>setresult(response.data.results))
        console.log(name)
    }
